import Header from './Header.js';
import fotoSobre from '../../img/fotoSobre.svg';

function Home() {
   return (
      <div className="Home">
         <Header />
         <div className='fundoHome'></div>
         <section className='sobre'>
            <img src={fotoSobre} className='fotoSobre'/>
            <div className='textosSobre'>
               <h1>Sobre </h1>
            </div>
         </section>
      </div>
   )
}

export default Home
